const AwsAmplifyConfig = {
    Auth: {
        userPoolId: process.env.POOL_USER_ID || "",
        region: process.env.POOL_REGION || "",
        userPoolWebClientId: process.env.POOL_CLIENT_ID || "",
    },
};

export default AwsAmplifyConfig;
